import './ExerciseList.scss';
import Exercise from './Exercise';
import WorkoutData from '../workouts.json';


var listItems = WorkoutData.map(item =>
  <div>
    <Exercise 
      name={ item.name } 
      type={ item.name } 
      timing={ item.name } 
      target={ item.name } 
    />
  </div>
);

const one = 12;


function ExerciseList() {
  return (
    <div className="ExerciseList">
            <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Type</th>
            <th>Timing</th>
            <th>Target Area</th>
          </tr>
        </thead>
        <tbody>
          { listItems }
        </tbody>
        </table>

        <button>Add Exercise</button>
    </div>
  );
}

export default ExerciseList;
